    <head>
        <meta charset=\"UTF-8\">
        <title>{% block title %}Welcome!{% endblock %}</title>
        <link rel=\"icon\" href=\"data:image/svg+xml,<svg xmlns=%22http://www.w3.org/2000/svg%22 viewBox=%220 0 128 128%22><text y=%221.2em%22 font-size=%2296%22>⚫️</text></svg>\">
        <link rel=\"stylesheet\" href=\"https://cdn.jsdelivr.net/npm/bootstrap@4.0.0/dist/css/bootstrap.min.css\" integrity=\"sha384-Gn5384xqQ1aoWXA+058RXPxPg6fy4IWvTNh0E263XmFcJlSAwiGgFAW/dAiS6JXm\" crossorigin=\"anonymous\">
        <script src=\"https://cdn.lordicon.com/lusqsztk.js\"></script>
        {% block stylesheets %}
            {{ encore_entry_link_tags('app') }}
        {% endblock %}

        {% block javascripts %}
            {{ encore_entry_script_tags('app') }}
        {% endblock %}
    </head>
    <body class=\"alert-danger\">
     
        <div class=\"container p-0\" style=\"border:1px solid white\">
              <nav class=\"navbar navbar-expand-lg navbar-light bg-light\">
                <a class=\"navbar-brand\" href=\"{{ path('post.index') }}\">SymfonyArticlesApp</a>
                <button class=\"navbar-toggler\" type=\"button\" data-toggle=\"collapse\" data-target=\"#navbarSupportedContent\" aria-controls=\"navbarSupportedContent\" aria-expanded=\"false\" aria-label=\"Toggle navigation\">
                    <span class=\"navbar-toggler-icon\"></span>
                </button>

                <div class=\"collapse navbar-collapse\" id=\"navbarSupportedContent\">
                    <ul class=\"navbar-nav mr-auto\">
                     {% if app.user %}
                    <li class=\"nav-item active\">
                        <a class=\"nav-link\" href=\"{{ path('post.index') }}\">Posts <span class=\"sr-only\">(current)</span></a>
                    </li>
                    <li class=\"nav-item\">
                        <a class=\"nav-link\" href=\"{{ path('custom', {name: 'Beau Carnes'}) }}\">Greet Beau Carnes</a>
                    </li>
                    {% endif %}
                    </ul>

                    <ul class=\"navbar-nav ml-auto\">
                    {% if app.user %}
                        <li class=\"nav-item\">
                            You are logged in as {{ app.user.username }}, <a href=\"{{ path('app_logout') }}\">Logout</a>
                        </li>
                    {% else %}
                        <li class=\"nav-item\">
                           <a href=\"{{ path('app_login') }}\">Login</a>
                        </li>
                    {% endif %}
                    </ul>
                </div>
            </nav>
            {% block body %}{% endblock %}
        </div>
